import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        Header
      </div>
      <Switch>
        <Route path="/" exact>
          <div className="app">
            <h1>
              <center>
                /
              </center>
            </h1>
          </div>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
